// Adicionar dados de aniversário e cargo aos associados
export const associadosComDados = associados.map(associado => {
  const dadosAniversario = aniversariantesOutubro[associado.matricula];
  
  // Criar objeto atualizado com categoria
  let atualizado: any = {
    ...associado
  };
  
  // Adicionar categoria para membros existentes se não tiver
  if (!atualizado.categoria) {
    if (atualizado.estado === 'estado') {
      atualizado.categoria = 'estadual';
    } else if (atualizado.estado === 'município') {
      atualizado.categoria = 'municipal';
    }
  }
  
  // Adicionar dados de aniversário se existir
  if (dadosAniversario) {
    atualizado.aniversario = `2024-10-${dadosAniversario.dia.padStart(2, '0')}`;
    
    // Só adicionar cargo se existir e não tiver cargo já definido
    if (dadosAniversario.cargo && !atualizado.cargo) {
      atualizado.cargo = dadosAniversario.cargo;
    }
  }
  
  return atualizado;
});